import './App.css';

const name = "Abhirup";
const element = <h2>I am a SDE at Amazon</h2>

const Header = () => {
  return (
    <div className='hearer'>
    <h1>AR</h1>
    <div className='search-bar'><input placeholder='Search Item' />
    <button>Search</button>
    </div></div>
  );
}

const Test = ({name}) => {
  return (
    <>
      <h1>Test Succesful {name}</h1>
    </>
  );
}

function App() {
  return (
    <div className='Main'>
      <h1>hello, I am {name}</h1>
      { element }
      <Test name="java"/>
    </div>
  );
}

export default App;
